DOWNLOAD_DIRECTORY = os.path.join("/Users","YutoTakamoto","Downloads","ani","music","Youtube")


ajaxOutput.strip()

splitOutput = ajaxOutput.split("|")
for url in splitOutput:
  url = url.strip()
